proxy-groups:
  - name: UpdateTimestamp
    include-all: true
    filter: (?i)Timestamp
    type: select
  - name: 游 坍낹
    type: select
    proxies:
      - 游댢 갬眄倣갳
      - 游뿳 곎궏갢꼭
      - 鮫勇 쀤궏괝길
      - DIRECT
  - name: 游댢 갬眄倣갳
    include-all: true
    filter: (?i)雷썬먼로|懶몊긽癩꾶SG|Singapore|毛꾶柳뮎곷쌒訪쮡긜雷슾淡뉜갚번썬릝|榜좬걀盼뗲蔑方읖긜雷某언먽둺|榴療괞맀|喇擔됀룦喇긜긜|髮副騰쭆궇먼닌|US|United States|夫뽼띻|夫뼢KR|France|柳됀띻|Paris|Netherlands
    type: select
  - name: 游뿳 곎궏갢꼭
    include-all: true
    type: select
  - name: 鮫勇 쀤궏괝길
    type: url-test
    include-all: true
    interval: 300
    tolerance: 100
